                `<div>
                     19 Aug 44<br>nan<br>Trun<br>Afternoon and evening Regiment very busy on "Mike" and "Uncle" Targets, both with ground and air O.P's. Busiest time for the Regiment in quite some time - shoots effective as many enemy surrendered in target area. Tanks also engaged. Falaise Gap closed.
                 </div>`,
                {"sticky": true}
            );

            marker_d12d4d3a64f32386ddabd39b8e020edc.bindTooltip(
                `<div>
                     23 Aug 44<br>nan<br>Ryes<br>Quiet during night. Regt ceased firing and moved at 0630 hrs in two columns, one wheeled and one tracked. Roads very bad owing to mud and heavy traffic made travel difficult. First part of Regt arrived at RA Re-Org Camp at RYES at 1500 hrs. Officers briefed by C.O. on refit.  Exchanged 105mm Priest Self Propelled guns for Sexton 25 lb Self Propelled Gun.
                 </div>`,
                {"sticky": true}
            );
